India’s Mother and Child Tracking System (MCTS) is an information system for tracking maternal and child health beneficiaries in India’s public health system, and improving service delivery planning and outcomes. This ambitious project was launched in 2009 and currently covers all states in India.
The MCTS is designed to capture and track all pregnant women (from conception up to 42 days post-partum) and all new-born children (up to 5 years of age). Its objectives are to ensure that :
- all pregnant women receive their full Antenatal Care (ANC) and Postnatal Care (PNC) services at the due times;
- institutional deliveries for pregnant women, particularly for high risk mothers, are encouraged; 
- and all children receive the full immunisation schedule at the due times.
